const request = require('supertest');
const app = require('../../index');
const auth = require('../../services/authentication');
const connection = require('../../connection');

jest.mock('../../services/authentication');
const loanDelete = () => {
  const queryDelete = 'delete from loan where userId=13';
  connection.query(queryDelete,
    (err) => {
      if (err) { console.log('Error while deleting the user'); }
    });
};
describe('test get all loan data route', () => {
  const userId = 12;
  const file = 'data:application/pdf;base64,';
  auth.authenticationToken.mockImplementation((req, res, next) => next());
  it('GET /loan --> array get loan using userId', async () => {
    const { status, body: { data: [loanData] } } = await request(app)
      .get('/loan')
      .query({ userId });
    expect(status).toBe(200);
    expect(loanData).toEqual({
      id: expect.any(Number),
      userId: expect.any(Number),
      amount: expect.any(Number),
      file: expect.any(String),
      duration: expect.any(Number),
      installment: expect.any(Number),
    });
  });

  it('GET /loan/all --> array get all loan', async () => {
    const { status, body: { data: [loanData] } } = await request(app)
      .get('/loan/all');
    expect(status).toBe(200);
    expect(loanData).toEqual({
      name: expect.any(String),
      amount: expect.any(Number),
      file: expect.any(String),
      duration: expect.any(Number),
      installment: expect.any(Number),
    });
  });

  it('POST /loan --> loan add', async () => {
    const { status, body: { message } } = await request(app)
      .post('/loan')
      .send({
        userId: 13,
        amount: 10000,
        duration: 10,
        file,
      });
    expect(status).toBe(200);
    expect(message).toEqual('Loan Add Successfully');
  });

  it('POST /loan --> loan update', async () => {
    const { status, body: { message } } = await request(app)
      .post('/loan')
      .send({
        id: 17,
        userId: 13,
        amount: 10000,
        duration: 10,
        file,
      });
    expect(status).toBe(200);
    expect(message).toEqual('Loan Updated Successfully');
  });
  afterAll(() => {
    loanDelete();
    jest.resetAllMocks();
  });
});
